import React from 'react';
import { letters } from './menus/options'; // Importing letters from options.js

const LetterDropdown = ({ onSelectLetter }) => {
  return (
    <select onChange={(e) => onSelectLetter(e.target.value)}>
      {letters.map((letter) => (
        <option key={letter} value={letter}>
          {letter}
        </option>
      ))}
    </select>
  );
};

export default LetterDropdown;
